import React from "react";

const AddGoal = () => {
  const formStyles = {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    gap: "1em",
    textAlign: "center",
    backgroundColor: "rgb(73, 146, 255)",
    color: "white",
    padding: "1em 0",
    width: "75%",
    margin: "0 auto",
    borderRadius: "0.5rem",
  };

  const formControlStyles = {
    display: "flex",
    flexDirection: "column",
    gap: "0.5em",
    fontSize: "0.875rem",
    width: "50%",
  };

  const inputStyles = {
    border: "None",
    padding: "0.5em",
    borderRadius: "0.25rem",
  };

  const submitStyles = {
    width: "100%",
  };

  return (
    <form className="goal-add-form" style={formStyles}>
      <div className="form-control" style={formControlStyles}>
        <p>Goal</p>
        <input type="text" placeholder="Add Goal" style={inputStyles} />
      </div>
      <div className="form-control" style={formControlStyles}>
        <p>Day</p>
        <input type="text" style={inputStyles} />
      </div>
      <div className="form-control" style={formControlStyles}>
        <p>Month</p>
        <input type="text" style={inputStyles} />
      </div>
      <div className="form-control" style={formControlStyles}>
        <p>Year</p>
        <input type="text" style={inputStyles} />
      </div>

      <input type="submit" value="Save Goal" style={submitStyles} />
    </form>
  );
};

export default AddGoal;
